import React, { Component } from "react";
import "./payinvoice.css";
import Axios from "axios";

class payinvoce extends Component {
  constructor(props) {
    super(props);
    this.state = {
      payload: [],
    };
  }
  componentDidMount = () => {
    Axios.post("./rangesumReport");
  };

  render() {
    return <div>Invonce for Company</div>;
  }
}

export default payinvoce;
